        "B1a": ["everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack", "everypack"],
